function updateFrame(item) {
    var frame = item.data;
    if (frame.mapping === Global) {
        delete item.children;
        return;
    }
    var props = Properties.own(frame.mapping).sort();
    var lookup = {};
    if (item.children) item.children.each(function(i) { lookup[i.name] = i; });
    item.children = [];
    props.each(function(prop) {
        var existing = lookup[prop];
        if (existing) {
            existing.data = frame.mapping[prop];
            item.children.push(existing);
        } else {
            item.children.push(this.createItem(frame.mapping, prop));
        }
    }, this);
    if (frame.containingScope) {
        var fname = frame.containingScope.mapping === Global
                  ? 'Global'
                  : frame.containingScope.getFuncName();
        var scopeItem = lookup[' '] || {name: ' '};
        scopeItem.description = '<containing scope: ' + fname + '>';
        scopeItem.data = frame.containingScope;
        this.updateFrame(scopeItem);
        item.children.push(scopeItem);
    }
}

