function setTopFrame(topFrame) {
    this.topFrame = topFrame;
    var frames = [];
    var frame = topFrame;
    do {
        var name = frame.getFuncName();
        frames.push({
            isListItem: true,
            string: frame.isResuming() ? name : name + " [native]",
            value: frame
        });
    } while (frame = frame.getCaller());
    this.get("FrameList").updateList(frames);
    this.get("FrameList").setSelection(topFrame);
    return true;
}

